using Microsoft.ML.OnnxRuntime;
using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Numerics.Tensors;
using System.Text;

namespace ASAUDF
{
    public class onnxModel
    {
        //encoded model that has been trained on NYC taxi data to predict fares.
        private const string Model = @"";
        private static InferenceSession session;

        static onnxModel()
        {
            byte[] bytes = Convert.FromBase64String(Model);
            string file = Path.GetTempFileName();
            File.WriteAllBytes(file, bytes);

            session = new InferenceSession(file);
        }

        //C# user-defined function that will be invoked in the Stream Analytics query to do the prediction.
        public static float Score(
            String vendorIDs,
            double passengerCountd,
            double tripDistanced,
            double month_numd,
            double day_of_monthd,
            double day_of_hourd)
        {
            float vendorID = 0;
            if (vendorIDs.Equals("VTS"))
                vendorID = 1;

            float passengerCount = (float)passengerCountd;
            float tripDistance = (float)tripDistanced;
            float month_num = (float)month_numd;
            float day_of_month = (float)day_of_monthd;
            float day_of_hour = (float)day_of_hourd;

            var inputMeta = session.InputMetadata;
            string f = string.Join(", ", inputMeta.Keys);

            var container = new List<NamedOnnxValue>();
            container.Add(NamedOnnxValue.CreateFromTensor<float>(
                @"vendorID",
                new DenseTensor<float>(new[] { vendorID }, inputMeta[@"vendorID"].Dimensions)));

            container.Add(NamedOnnxValue.CreateFromTensor<float>(
                @"passengerCount",
                new DenseTensor<float>(new[] { passengerCount }, inputMeta[@"passengerCount"].Dimensions)));

            container.Add(NamedOnnxValue.CreateFromTensor<float>(
                @"tripDistance",
                new DenseTensor<float>(new[] { tripDistance }, inputMeta[@"tripDistance"].Dimensions)));

            container.Add(NamedOnnxValue.CreateFromTensor<float>(
                @"month_num",
                new DenseTensor<float>(new[] { month_num }, inputMeta[@"month_num"].Dimensions)));

            container.Add(NamedOnnxValue.CreateFromTensor<float>(
                @"day_of_month",
                new DenseTensor<float>(new[] { day_of_month }, inputMeta[@"day_of_month"].Dimensions)));

            container.Add(NamedOnnxValue.CreateFromTensor<float>(
                @"day_of_hour",
                new DenseTensor<float>(new[] { day_of_hour }, inputMeta[@"day_of_hour"].Dimensions)));

            // Run the inference
            using (var results = session.Run(container))  // results is an IDisposableReadOnlyCollection<DisposableNamedOnnxValue> container
            {
                var r = results.Single();
                return r.AsTensor<float>().FirstOrDefault();
            }
        }
    }
}
